CREATE DATABASE starfleetDb;
USE starfleetDb;



-- create rank table

create table IF NOT EXISTS rank (
rankCode varchar(5),
rank varchar(30),
rankCategory varchar(30),
nextSeniorRank varchar(5),
primary key (rankCode)
)engine=InnoDB;



-- create species table

create table IF NOT EXISTS species (
species varchar(30) PRIMARY KEY
)engine=InnoDB;



-- create vessel table

create table IF NOT EXISTS vessel (
callsign varchar(15) PRIMARY KEY,
name varchar(40),
classification varchar(40)
)engine=InnoDB;



-- create crew member table

create table IF NOT EXISTS crewMember (
serialNumber varchar(40),
lastName varchar(30),
firstName varchar(30),
species varchar(30),
birthday datetime,
rankCode varchar(8),
currentShipCallsign varchar(15),
foreign key (rankCode) References rank(rankCode),
foreign key (species) REFERENCES species(species),
foreign key (currentShipCallSign) references vessel(callsign),
primary key (serialNumber) 
)engine=InnoDB;



